css:
@-webkit-keyframes spin {
  0% {
    transform: rotate(0deg);
  }
  100% {
    transform: rotate(360deg);
  }
}
.spin {
  animation: spin 2.5s linear infinite;
}
@-webkit-keyframes flash {
  0% {
    opacity: 0.2;
  }
  50% {
    opacity: 1.0;
  }
  100% {
    opacity: 0.2;
  }
}
@-webkit-keyframes flash-background-success {
  0% {
    background-color: rgba(23, 202, 101, 0);
    background-image: -webkit-linear-gradient(rgba(23, 202, 101, 0), rgba(23, 202, 101, 0.1));
  }
  20% {
    background-color: rgba(23, 202, 101, 0.3);
    background-image: -webkit-linear-gradient(rgba(23, 202, 101, 0.3), rgba(23, 202, 101, 0.1));
  }
  80% {
    background-color: rgba(23, 202, 101, 0.3);
    background-image: -webkit-linear-gradient(rgba(23, 202, 101, 0.3), rgba(23, 202, 101, 0.1));
  }
  100% {
    background-color: rgba(23, 202, 101, 0);
    background-image: -webkit-linear-gradient(rgba(23, 202, 101, 0), rgba(23, 202, 101, 0.1));
  }
}
@-webkit-keyframes flash-background-error {
  0% {
    background-color: rgba(204, 0, 0, 0);
    background-image: -webkit-linear-gradient(rgba(204, 0, 0, 0), rgba(204, 0, 0, 0.1));
  }
  20% {
    background-color: rgba(204, 0, 0, 0.3);
    background-image: -webkit-linear-gradient(rgba(204, 0, 0, 0.3), rgba(204, 0, 0, 0.1));
  }
  80% {
    background-color: rgba(204, 0, 0, 0.3);
    background-image: -webkit-linear-gradient(rgba(204, 0, 0, 0.3), rgba(204, 0, 0, 0.1));
  }
  100% {
    background-color: rgba(204, 0, 0, 0);
    background-image: -webkit-linear-gradient(rgba(204, 0, 0, 0), rgba(204, 0, 0, 0.1));
  }
}
.spin-flash {
  animation: flash 0.5s linear infinite, spin 2.5s linear infinite;
}
